import React from "react";
import Products_Details from "./ProductsDetail";
import "./Product.css";
import {products} from './ProdductData'
function Product() {
   
  return (
    <>
      <div className="Product">
        {Products.map((product) => (
          <div className="product_y" key={product.id}>
            <Products_Details Products={Products} key={Products.id} />
          </div>
        ))}
      </div>
    </>
  );
}
export default Product;
